import React, { Component } from 'react';


class Control extends Component {
  render () {
    return (
      <ul>
        <li><a 
          href="/create"
          onClick={function (event) {
            event.preventDefault();
            this.props.onChangeMode('create');
          }.bind(this)}
        >create</a></li>
        <li><input type="button" value="delete"/></li>
      </ul>
    );
  }
}

export default Control;
